import React from 'react';
import ReactDOM from 'react-dom/client';

// Renderiza o conteúdo dentro do elemento "root" no index.html
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <h1>Olá, UniQuest!</h1>
  </React.StrictMode>
);
